svg.script:
function clickHandler(name){
    if(window.parent.zoomClickHandler){
        window.parent.zoomClickHandler(name);
    }
}
function mouseOverHandler(name){
    if(window.parent.zoomMouseOverHandler){
        window.parent.zoomMouseOverHandler('Vietnam', name);
    }
}

function mouseLeaveHandler(name){
    if(window.parent.zoomMouseLeaveHandler){
        window.parent.zoomMouseLeaveHandler('Vietnam', name);
    }
}
